import React from 'react';

const Time= ()=>{
    const getTime = ()=>{
        console.log("get Time " + new Date().toLocaleString)
    }
    return(
        <>
            <h1>Time To Show</h1>
            <button onClick={getTime}>Click Me</button>
        </>
    )
}

export default Time;
